import React from 'react';
import styles from './Styles.module.css'

const Header = props => {

    return (
        <React.Fragment>
            <header className={styles.header}> 
                <h1>React Meals</h1>
            </header>
            <div className={styles['main-image']}>
                <img src="../../assests/meals.jpg" alt="" />
            </div>
        </React.Fragment>
    )
};

export default Header;
